import React, { Component } from "react";

export default class Ccomponent extends Component {
  constructor(props) {
    super(props);

    this.state = {
      name: "Alex",
    };
  }

  render() {
    const name = this.state.name;
    return (
      <div>
        <h1>Class component {name}</h1>
      </div>
    );
  }
}
